u043d\u044e \u041c\u043e\u043d\u0442\u0435\u043d\u044c\">\u0430\u0432\u0435\u043d\u044e \u041c\u043e\u043d\u0442\u0435\u043d\u044c<\/a> \u0432 \u041f\u0430\u0440\u0438\u0436\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D0%BA%D0%BB%D0%B8,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC_%D0%91%D1%80%D1%8D%D0%B4%D1%84%D0%BE%D1%80%D0%B4\" title=\"\u0428\u043e\u043a\u043b\u0438, \u0423\u0438\u043b\u044c\u044f\u043c \u0411\u0440\u044d\u0434\u0444\u043e\u0440\u0434\">\u0423\u0438\u043b\u044c\u044f\u043c \u0428\u043e\u043a\u043b\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%B4%D0%B8%D0%BD,_%D0%94%D0%B6%D0%BE%D0%BD\" title=\"\u0411\u0430\u0440\u0434\u0438\u043d, \u0414\u0436\u043e\u043d\">\u0414\u0436\u043e\u043d \u0411\u0430\u0440\u0434\u0438\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%82%D1%82%D0%B5%D0%B9%D0%BD,_%D0%A3%D0%BE%D0%BB%D1%82%D0%B5%D1%80_%D0%A5%D0%B0%D1%83%D0%B7%D0%B5%D1%80\" title=\"\u0411\u0440\u0430\u0442\u0442\u0435\u0439\u043d, \u0423\u043e\u043b\u0442\u0435\u0440 \u0425\u0430\u0443\u0437\u0435\u0440\">\u0423\u043e\u043b\u0442\u0435\u0440 \u0411\u0440\u0430\u0442\u0442\u0435\u0439\u043d<\/a> \u0432 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044f\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Bell_Labs\" class=\"mw-redirect\" title=\"Bell Labs\">Bell Labs<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043e\u0437\u0434\u0430\u043b\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%BF%D0%BE%D0%BB%D1%8F%D1%80%D0%BD%D1%8B%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D0%B7%D0%B8%D1%81%D1%82%D0%BE%D1%80\" title=\"\u0411\u0438\u043f\u043e\u043b\u044f\u0440\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0437\u0438\u0441\u0442\u043e\u0440\">\u0431\u0438\u043f\u043e\u043b\u044f\u0440\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0437\u0438\u0441\u0442\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u041f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B1%D0%BE%D0%B4%D0%B6%D0%B0\" title=\"\u041a\u0430\u043c\u0431\u043e\u0434\u0436\u0430\">\u041a\u0430\u043c\u0431\u043e\u0434\u0436\u0438<\/a>, \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0435\u0439\u0441\u044f \u0441 1880 \u0433\u043e\u0434\u0430 \u043f\u043e\u0434 \u043f\u0440\u043e\u0442\u0435\u043a\u0442\u043e\u0440\u0430\u0442\u043e\u043c \u0424\u0440\u0430\u043d\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0%D0%B4_%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA%D0%BE%D0%BC\" title=\"\u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u043d\u0430\u0434 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u043e\u043c\">\u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0434\u0432\u0443\u0445 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0438\u0445 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u0432<\/a> \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u043e\u043c<\/a>. 134 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445. \u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u043c\u0438\u0440\u0435 \u043d\u0430 \u0442\u043e \u0432\u0440\u0435\u043c\u044f. \u041f\u0440\u0438 \u0440\u0430\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0431\u044b\u043b\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u044b \u0434\u0430\u043d\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%80%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D1%81%D0%B0%D0%BC%D0%BE%D0%BF%D0%B8%D1%81%D0%B5%D1%86\" title=\"\u0411\u043e\u0440\u0442\u043e\u0432\u043e\u0439 \u0441\u0430\u043c\u043e\u043f\u0438\u0441\u0435\u0446\">\u0431\u043e\u0440\u0442\u043e\u0432\u044b\u0445 \u0441\u0430\u043c\u043e\u043f\u0438\u0441\u0446\u0435\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B8%D1%82%D0%B0%D1%82%D1%8B_%D0%9C%D0%B0%D0%BE_%D0%A6%D0%B7%D1%8D%D0%B4%D1%83%D0%BD%D0%B0\" title=\"\u0426\u0438\u0442\u0430\u0442\u044b \u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d\u0430\">\u00ab\u0426\u0438\u0442\u0430\u0442 \u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d\u0430\u00bb<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%BA%D0%B8%D0%BD\" title=\"\u041f\u0435\u043a\u0438\u043d\">\u041f\u0435\u043a\u0438\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%81%D0%BC%D0%B8%D1%80%D0%B5%D0%BD%D0%B8%D0%B5_%D1%88%D0%B0%D1%85%D1%82%D1%8B_%D0%92%D1%83%D0%B5%D0%BA\" title=\"\u0423\u0441\u043c\u0438\u0440\u0435\u043d\u0438\u0435 \u0448\u0430\u0445\u0442\u044b \u0412\u0443\u0435\u043a\">\u0443\u0441\u043c\u0438\u0440\u0435\u043d\u0438\u0435 \u0448\u0430\u0445\u0442\u044b \u0412\u0443\u0435\u043a<\/a>, \u0430\u043d\u0442\u0438\u0437\u0430\u0431\u0430\u0441\u0442\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0430\u043a\u0446\u0438\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u043c\u0438\u043b\u0438\u0446\u0438\u0438 \u0438 \u0430\u0440\u043c\u0438\u0438 \u043d\u0430 \u0443\u0433\u043e\u043b\u044c\u043d\u043e\u0439 \u0448\u0430\u0445\u0442\u0435 \u0412\u0443\u0435\u043a \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%BE%D0%B2%D0%B8%D1%86%D0%B5\" title=\"\u041a\u0430\u0442\u043e\u0432\u0438\u0446\u0435\">\u041a\u0430\u0442\u043e\u0432\u0438\u0446\u0435<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e\u043c \u0434\u0435\u0432\u044f\u0442\u0438 \u0448\u0430\u0445\u0442\u0435\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%BE%D0%B1%D1%8B%D1%82%D0%B8%D1%8F_%D0%B2_%D0%90%D0%BB%D0%BC%D0%B0-%D0%90%D1%82%D0%B5\" title=\"\u0414\u0435\u043a\u0430\u0431\u0440\u044c\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u044f \u0432 \u0410\u043b\u043c\u0430-\u0410\u0442\u0435\">\u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u043a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%BC%D0%B0-%D0%90%D1%82%D0%B0\" title=\"\u0410\u043b\u043c\u0430-\u0410\u0442\u0430\">\u0410\u043b\u043c\u0430-\u0410\u0442\u0435<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u043f\u043b\u0435\u043d\u0443\u043c\u0430 \u0426\u041a \u041a\u043e\u043c\u043f\u0430\u0440\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%