.org\/wiki\/%D0%9C%D1%83%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041c\u0443\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041c\u0443\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a>) \u041d\u0438\u043d\u0430 \u0412\u0430\u0440\u043b\u0430\u043c\u043e\u0432\u0430 \u0443\u0431\u0438\u0442\u0430 \u0432\u043e\u0437\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%BE%D0%B4%D1%8A%D0%B5%D0%B7%D0%B4&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u043e\u0434\u044a\u0435\u0437\u0434 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u043f\u043e\u0434\u044a\u0435\u0437\u0434\u0430<\/a> \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u0416\u0438\u043b\u0438\u0449\u0435\">\u0434\u043e\u043c\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%B0%D0%B2%D1%82%D0%BE%D0%B1%D1%83%D1%81%D0%B0_16_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8F_2008_%D0%B3%D0%BE%D0%B4%D0%B0_%D0%B1%D0%BB%D0%B8%D0%B7_%D0%AD%D0%B9%D0%BB%D0%B0%D0%B9%D1%82%D0%B0\" class=\"mw-redirect\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430 16 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 2008 \u0433\u043e\u0434\u0430 \u0431\u043b\u0438\u0437 \u042d\u0439\u043b\u0430\u0439\u0442\u0430\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430 16 \u0434\u0435\u043a\u0430\u0431